import React, {useEffect} from 'react';
import {useSelector} from "react-redux";
import styles from "./ShowWords.module.css"


const ShowWords = () => {
    const n = useSelector(state => state.WordsReducer)
    let counter = 0;
    return (
        <div>
            <table>
                <thead>

                </thead>
                {
                n.map(el => {
                    ++counter
                    return <ul key={counter}>

                        <tbody>
                        {el.eng}
                        {el.ukr}
                        </tbody>

                    </ul>
                })
            }</table>
        </div>
    );
};

export default ShowWords;
